import Header from '../layouts/header';
import Footer from '../layouts/footer';
import React from 'react';
import Table from '../components/data table';
import ReactDOM from 'react-dom/client';
import './CSS/main.css'

export default function TemplateDashboard() {

const header = ReactDOM.createRoot(document.getElementsByTagName('header')[0]);
header.render(<Header clientName="David Page" serviceName="Associate Solutions Architect" />);

const table = ReactDOM.createRoot(document.getElementById("table"));
table.render(<Table />)

const footer = ReactDOM.createRoot(document.getElementsByTagName("footer")[0]);
footer.render(<Footer changeCompany="Change Company/Service"/>);

}
